import React from 'react';
import CardPic from '../../Design/CardPic'
import { Container, Row, Col } from 'react-bootstrap'
import '../../../assets/css/home.css'
import supplementalData from '../../../assets/json/supplementalData.json'


const Supplemental = () => {

    return(
        <div className="wallpaper" style={{backgroundColor: '#e3d3a6'}}>
            <div style={styles.screenContainer} id="supplemental">
                <Row>
                        <Col>
                            <h1>Supplemental</h1>
                            <hr style={styles.line}/>
                        </Col>
                    </Row>
                <Row>
                {supplementalData.map(item=>(
                    <Col  xl={4} large={4} md={6} sm={12} xs={12} key={item.id}>
                        <CardPic 
                            key={item.id}
                            image={require('../../../assets/images/Projects/Supplemental' + item.image)}
                            title={item.title}
                            description={item.description}
                            style={styles.cardStyle}
                            localIcons={item.localIcons}
                            github={item.github}
                            demo={item.demo}
                        />
                    </Col>
                    ))}
                </Row>
            </div>  
        </div>
    )

}

const styles= {

    screenContainer: {
        paddingTop: '4em',
        paddingBottom: '10em',
        paddingLeft: '6em',
        paddingRight: '6em'
    },
    cardStyle: {
        boxShadow: '0 8px 6px -6px black',
        borderRadius: '55px 55px 55px 55px',
        height: '50vh',
        width: '50vh',
        maxHeight: '50vh',
        overflow: "hidden",
        cursor: "pointer"
    },
    line: {
        width: '5em',
        border: '0.1em solid blue',
        marginLeft: 0
    },

}

export default Supplemental
